import DemoLevel from "./DemoLevel";
import Level1 from "./Level1";
import Level2 from "./Level2";
import Level3 from "./Level3";

const Levels = {
  DemoLevel: DemoLevel,
  Level2: Level2,
  Level3: Level3,
  Level4: Level4,
};

export default Levels;
